import React from 'react';
import { CircularProgressbar } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

export default class Result extends React.Component{
    constructor()
    {
        super();
        this.grades=JSON.parse(window.localStorage.getItem('marks'));
    }
    render(){
        return(
            <div>
                <h3>Your Results are:</h3>

               { console.log(JSON.parse(window.localStorage.getItem('marks')))}
                <div class="d-flex justify-content-around mt-5">
                    <Example label="Q1">
                <div style={{width:200 ,height:200}} >
                <CircularProgressbar value={this.grades[0]*5} maxValue={5} text={`${this.grades[0]}`+'/5'}  /> 
                </div>
                </Example>
                <div style={{width:200 ,height:200}}>
                <CircularProgressbar value={this.grades[1]*5} maxValue={5} text={`${this.grades[1]}`+'/5'}  /> 
                </div>
                <div style={{width:200 ,height:200}}>
                <CircularProgressbar value={this.grades[2]*5} maxValue={5} text={`${this.grades[2]*5}`+'/5'}  /> 
                </div>
                </div>
            </div>
        )
    }
}
